import React, { Component } from 'react'

export class Login extends Component {
    constructor(props) {
        super(props)

        this.state = {
             message:'Hello'
        }
    }
    clickHander(){
        this.setState({
            message:'Good Bye'
        })
        console.log(this)

    }

    render() {
        return (
            <div>
                <div>{this.state.message}</div>
                <button onClick={this.clickHander.bind(this)}>EventBindButton</button>
            </div>
        )
    }
}

export default Login
